import React from "react";
import { Link } from "react-router-dom";

const RecipeRec = ({ recipeRec, factor1, factor2, selectionInfo }) => {
  if (recipeRec.hits) {
    return (
      <div className="recipe-rec">
        <div className="recipe-image-container">
        <img src={recipeRec.hits[0].recipe.image} alt="first recipe" key="0"/>
        </div>
        <h3>{recipeRec.hits[0].recipe.label}</h3>
        <p>This recipe has {factor1} and {factor2}, which pair well with your {selectionInfo.name}</p>
        <Link to="/">Back to Home.</Link>
      </div>
    );
  } else {
    return (
      <div className="recipe-rec">
        <p>Nothing yet.</p>
        <Link to="/">Back to Home.</Link>
      </div>
    );
  }
};

export default RecipeRec;
